export function Person (props) {
    return <div>
        <div>
            Nome: {props.name}
        </div>
        <div>
            Idade: {props.age}
        </div>
        <div>
            Sexo: {props.gender}
        </div>
    </div>
}

const people =[
    { name: 'Carlos', age: 34, gender: 'Male'},
    { name: 'Bruno', age: 30, gender: 'Male'},
]

export function People () {
    return <div>
        <Person name={'Carlos'} age={'34'} gender={'Male'} />
        <Person name={'Bruno'} age={'30'} gender={'Male'} />
    </div>
}

export default function App () {
    return <div>
        <People />
    </div>
}
